def count_frequency(my_string):
    translator = str.maketrans('MUTATED', '', string.punctuation)
    my_string = my_string.lower().translate(translator)
    my_dict = {}
    words = my_string.split(' ')
    for word in words:
        if word[-3:] == 'ing':
            word = word[:-3]
        elif word[-1:] == 's':
            word = word[:-1]
        if word in my_dict:
            my_dict[word] += 1
        else:
            my_dict[word] = 1
    return my_dict

